-- DROP TABLE IF EXISTS `sys_data_dict`;
CREATE TABLE `sys_data_dict`  (
  `DATA_DICT_ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '主键（取公共框架生成的GUID）',
  `SYSTEM_ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'SYS_SYSTEM_INFO/SYSTEM_id',
  `DICT_CODE` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '字典编码',
  `DICT_NAME` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '字典名称',
  `REMARK` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '备注',
  `STATE` decimal(1, 0) NULL DEFAULT NULL COMMENT '状态：1=有效/0=无效',
  `ORDER_NO` decimal(10, 0) NULL DEFAULT NULL COMMENT '排序',
  `CREATOR_ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人ID',
  `CREATOR_NAME` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人姓名',
  `CREATE_DATE` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `MODIFIER_ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '修改人ID',
  `MODIFIER_NAME` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '修改人姓名',
  `MODIFY_DATE` datetime(0) NULL DEFAULT NULL COMMENT '修改时间',
  `ISEDIT` decimal(1, 0) NOT NULL COMMENT '可编辑：提供给业务部门编辑',
  PRIMARY KEY (`DATA_DICT_ID`) USING BTREE,
  INDEX `PK_SYS_DICCODE`(`DICT_CODE`) USING BTREE,
  INDEX `PK_SYS_DICCODESTATE`(`STATE`, `DICT_CODE`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

